window.bookSummaryJSON = "<p><b>The </b><b><i>RuPaul's Drag Race</i></b><b> legends, stars of </b><b><i>UNHhhh</i></b><b>, and expert biological women share the secrets of their feminine mystique in this satirical guide to beauty and homemaking.&nbsp;</b></p> <p>Drag superstars Trixie Mattel and Katya have long captivated fans with their stunning looks, onscreen chemistry, and signature wit. In <i>Trixie and Katya's Guide to Modern Womanhood</i>, the pair channels that energy into an old-school etiquette guide for ladies.</p> <p>In essays, conversations, and how-to sections, Trixie and Katya will advise listeners on beauty and fashion and tackle other vital components of a happy home, such as money, self-love, and friendship; sharing advice and personal stories in high-concept fashion.&nbsp;</p> <p>Informative, humorous, and heartwarming, <i>Trixie and Katya's Guide to Modern Womanhood</i> is the audiobook that their fans have been waiting for.</p>"; 
